import './products.css';

function Products() {

    return (
        <div className='products'>
            <div className='prodcuts-card-wrapper'>
                <div className='pcw-card'>
                    <div className='pcw-card-image'></div>
                    <div className='pcw-card-bottom'>
                        <div className='pcwcb-headline'></div>
                        <div className='pcwcb-platforms'></div>
                    </div>
                </div>
                <div className='pcw-learn-more'></div>
            </div>
        </div>
    )
}
export default Products;
